import { useSelector } from "react-redux"

function Grades() {
  const [grades, setGrades] = useState([]);
  const utis = useSelector(state => state.class.UTIS);

  useEffect(() => {
    const fetchGrades = async () => {
      try {
        const response = await fetch(`http://localhost:8000/gradesof/${utis}`);
        
